import React, { Component } from "react";
import EmailButton from "./EmailButton";
 
class Contact extends Component {
  render() {
    return (
      <div id="contactMe">
      <div id="contactHeader">
        <h2>Contact Me</h2>
        <p>
          Have a question or want to hire me?
        </p>
        <EmailButton/>
      </div>
      <hr />
      </div>
    );
  }
}
 
export default Contact;
